import wallyimage from './assets/wallyimage.png'

function Header(props) {

    return (
        <div id = 'header-wrapper' >



            <div id ="title-wrapper">
                <h1>Where's</h1>
                <h1>Wally?</h1>
            </div>

            <img src={wallyimage}></img>

        </div>
    )
}

export default Header;
